const X3matrix = () => {
  return (
    <>
      <div classname="holder">
        <div className="matrix-head">
          <div className="level">1</div>
          ID: 10
        </div>
        <div className="downlines"></div>
      </div>
      <style jsx>{`
        .holder {
          width: auto;
          width: 200px;
        }
        .matrix-head {
          background: black;
          display: grid;
          grid-template-columns: 50px 150px;
        }
        .level {
          background: lightblue;
          width: 10%;
        }
      `}</style>
    </>
  );
};

export default X3matrix;
